                                                <p>(推薦状) 娘 19 歳 昨年８月より滞在中です。場所が学校より近く、通学路にはスーパーなどの お店もあり非常に便利です。こんなにいいところに、出来れば昨年春の入学と同時に ホームスイをしたかったのですが、学校側との半年間は入寮との約束があったため、 まちにまって退寮と同時にこちらに入居しました。 娘はまだ 19 歳です。とても心配でした。でも、娘から、Matt さんのところでホームステ イをさせて頂くことになったと連絡があった時の最初の言葉が『お母さん！安心して！ Matt さんはとても良い人。日本の親たちが心配していることを よくわかってみえるの で、まるで親代わりのように親切だよ。』でした。 そのあとすぐに</p>

